import React from "react";

function Contact () {
    return (
        <div id="contact">
         <div className="contact-input">
             <input  type='email' placeholder="email@gmail.com">
                <a href="#">Contact</a>
             </input>
         </div>
        </div>
    )
}
export default Contact;
